import React, {FC} from 'react';

export interface ToeProps {
    index?: number
}

const Toe: FC<ToeProps> = () => {
    return (
        <div style={{
            border:'1px solid black',
            display:'flex',
            backgroundColor:'lightgray',
            width:'90px',
            height:'90px',
            flexWrap:'wrap'
        }}
        >
        </div>
    );
};

export default Toe;
